import React from "react";
import Card from "../UI/Card";

const MissionList = (props) => {
  console.log(props.missionList);
  return (
    <>

      <ul>
        {props.missionList.map((mission) => (
          <Card className="w-96">
          <li key={mission[0].id}>
            Type : {mission[0].missionType} 
          </li>
          </Card>
        ))}
      </ul>

    </>
  );
};
export default MissionList;
